reference:
Firestore에서 users 콜렉션의 모든 users 정보를 가져오려면 다음과 같은 코드를 사용할 수 있습니다:

```javascript
await db.collection("users").get().then((event) => {
    for (var doc in event.docs) {
        print("${doc.id} => ${doc.data()}");
    }
});
```
